import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const API = 'https://sheets.googleapis.com/v4/spreadsheets/1JbLq-KRysRSD6Xptw24p3I79takWfFwCTSY7nYbakPI/values:batchGet?'+
'ranges=Investment!B3:B7&ranges=Worst!F12:V12&'+//for base investments & worst data
'ranges=Worst!F17:V17&ranges=Worst!F22:V22&ranges=Worst!F27:V27&ranges=Worst!F32:V32&'+
'ranges=Mid!F12:V12&ranges=Mid!F17:V17&ranges=Mid!F22:V22&ranges=Mid!F27:V27&ranges=Mid!F32:V32&'+
'ranges=Best!F12:V12&ranges=Best!F17:V17&ranges=Best!F22:V22&ranges=Best!F27:V27&ranges=Best!F32:V32&'+
'valueRenderOption=FORMATTED_VALUE&majorDimension=ROWS&key=AIzaSyBhw79t2J0aRVOT2a0P0-Jh81TvwhK0VMI';

class App extends Component {

  constructor(){
    super();

    this.state = {
     baseInvestments:[],
	 WorstSets:[],
	 MidSets:[],
	 BestSets:[],
    };

  }


  componentDidMount(){

     fetch(API).then(response => response.json()).then(data => {
        console.log(data);
      let baseInvestments = data.valueRanges[0].values;
	  let worstArray=data.valueRanges[1].values[0];
      const rows = [];
      for (let i = 1; i < baseInvestments.length; i++) {
        let rowObject = {};
        for (let j = 0; j < baseInvestments[i].length; j++) {
          rowObject[baseInvestments[0][j]] = baseInvestments[i][j];
        }
        rows.push(rowObject);
      }

        this.setState({ items: rows });
        console.log(baseInvestments[0]);
    });

  }
  render() {
    const listItems = this.state.items.map((item) =>
    <li>{item.name} at Latitute {item.lat} and Longitude {item.lng} </li>
  );

    return (
      <div>
         <ul>{listItems}</ul>
      </div>
    );
  }
}

export default App;
